import React, { Component } from "react";

class MenuCategory extends Component {
	state = {};

	constructor(props) {
		super(props);
		var items;
		this.state = { items };
	}

	componentDidMount() {
		this.state.items = require("./menu" + this.props.id + "");
		console.log(this.state.map.get("filling"));
	}

	render() {
		return <div className="container"></div>;
	}
}

export default MenuCategory;
